#!/bin/bash

DATA=""

NETWORK=$1

SEED=$2

OPTIMIZER_RUNS=10000000

if [ "$NETWORK" == "local" ]; then
    ETH_RPC_URL="http://127.0.0.1:8545"
elif [ "$NETWORK" == "exported" ]; then
    echo "using exported ETH_RPC_URL=$ETH_RPC_URL"
else
    ETH_RPC_URL="https://$NETWORK.infura.io/v3/$INFURA_KEY"
fi

echo "$SEED"

# --gas-limit 19000001 \
# --gas-price 4gwei \

echo "---------------------------------------------------------"
echo "               forge create DotnuggV1Light       "
echo "---------------------------------------------------------"

RESULT=$(
    forge create DotnuggV1Light \
        --private-key "$ETH_PRIVATE_SECRET" \
        --rpc-url "$ETH_RPC_URL" \
        --from "$ETH_FROM" \
        --gas-price 4gwei \
        --optimize --optimizer-runs="$OPTIMIZER_RUNS" \
        --extra-output-files metadata
)

echo "$RESULT"

echo "---------------"

DOTNUGG=$(echo "$RESULT" | grep "Deployed" | sed "s/Deployed to: //g")
TX=$(echo "$RESULT" | grep "Transaction" | sed "s/Transaction hash: //g")

cast tx "$TX" --rpc-url "$ETH_RPC_URL"

echo "---------------"

echo "tx hash:             $TX"
echo "dotnugg deployed to: $DOTNUGG"
# echo "fatherA deployed to: $FATHERA"

echo "---------------------------------------------------------"
echo "    cast send lightWrite(bytes) to DotnuggV1Light        "
echo "---------------------------------------------------------"

RESULT=$(
    cast send "$DOTNUGG" "lightWrite(bytes)" "$DATA" \
        --private-key "$ETH_PRIVATE_SECRET" \
        --rpc-url "$ETH_RPC_URL" \
        --from "$ETH_FROM" \
        --chain-id 80001
)

echo "$RESULT"

# --gas-limit 19000001 \
# --gas-price 4gwei \
# --optimize --optimizer-runs="$OPTIMIZER_RUNS" \
# --extra-output-files metadata

# echo "$RESULT"

echo "---------------"

echo "tx hash:             $TX"
echo "fatherA deployed to: $FATHERB"
echo ""
echo "---------------------------------------------------------"
echo "               forge create NuggftV1            "
echo "---------------------------------------------------------"

RESULT=$(
    forge create NuggftV1 \
        --private-key "$ETH_PRIVATE_SECRET" \
        --rpc-url "$ETH_RPC_URL" \
        --from "$ETH_FROM" \
        --value 0.25ether \
        --optimize --optimizer-runs="$OPTIMIZER_RUNS" \
        --extra-output-files metadata \
        --constructor-args "$DOTNUGG"
)

echo "$RESULT"

echo "---------------"

NUGGFT=$(echo "$RESULT" | grep "Deployed" | sed "s/Deployed to: //g")
TX=$(echo "$RESULT" | grep "Transaction" | sed "s/Transaction hash: //g")

cast tx "$TX" --rpc-url "$ETH_RPC_URL"

echo "---------------"

xNUGGFT=$(cast call "$NUGGFT" 'xnuggftv1()(address)' --rpc-url "$ETH_RPC_URL")
DOTNUGG=$(cast call "$NUGGFT" 'dotnuggv1()(address)' --rpc-url "$ETH_RPC_URL")
GENESIS=$(cast call "$NUGGFT" 'genesis()(uint256)' --rpc-url "$ETH_RPC_URL")

echo "tx hash:             $TX"
echo "nuggft deployed to:  $NUGGFT"
echo "xnuggft deployed to: $xNUGGFT"
echo "dotnugg deployed to: $DOTNUGG"
# echo "fatherB deployed to: $FATHER"
echo "genesis block is:    $GENESIS"
echo "---------------------------------------------------------"

